import React from 'react';
import {
  Modal,
  Button,
} from 'react-bootstrap';

class TsModal extends React.Component {
  constructor(props) {
    super(props);
    this.handlePostReq = this.handlePostReq.bind(this);
  }

  handlePostReq(item) {
    fetch('/', {
      method: 'POST',
      body: JSON.stringify({
       "tableid": {item}
      })
     }).then((res) => res.json())
     .then((data) =>  console.log(data))
     .catch((err)=>console.log(err));
  }

  render() {
    var item = JSON.stringify(this.props.modalid);
    return (
      	<Modal show={this.props.show} onHide={this.props.onhide}>
          <Modal.Header closeButton>
          <Modal.Title>Book Tables</Modal.Title>
          </Modal.Header>
          <Modal.Body>            
            <hr />
            <Button bsStyle="primary" bsSize="small" href = 'http://localhost:4000/' onClick={() => { this.handlePostReq(item)}}>Pool table 1</Button>
            <Button bsStyle="primary" bsSize="small" href = 'http://localhost:4000/'>Pool table 2</Button>
            <Button bsStyle="primary" bsSize="small" href = 'http://localhost:4000/'>Snooker table 1</Button>
            <Button bsStyle="primary" bsSize="small" href = 'http://localhost:4000/'>Snooker table 2</Button>
            <Button bsStyle="primary" bsSize="small" href = 'http://localhost:4000/'>Snooker table 3</Button>
          </Modal.Body>
          <Modal.Footer>
            <Button onClick={this.props.onclick}>Close</Button>
          </Modal.Footer>
        </Modal>
    );
  }
}

export default TsModal;
